        .grow {

                    align-items: center;
        }

        .align-stretch {

        }

        .btn span {
            color: #ffffff;
            white-space: nowrap;
        }

        .white-block {
            background: linear-gradient(180deg, rgba(0, 0, 0) 0.04%, #000 62.43%);filter: blur(1.5rem);
            will-change: transform;
            width: 70rem;
            min-width: 150vw;
            min-height: 100vh;
            height: 50rem;
            left: 50%;
            -webkit-transform: translate(-50%, calc(100% - 6.5rem));
                -ms-transform: translate(-50%, calc(100% - 6.5rem));
                    transform: translate(-50%, calc(100% - 13rem));
         
        }

</div>
    <script>
        // First we get the viewport height and we multiple it by 1% to get a value for a vh unit
        let vh = window.innerHeight * 0.01;
        // Then we set the value in the --vh custom property to the root of the document
        document.documentElement.style.setProperty('--vh', `${vh}px`);

/*
        window.addEventListener('loaded', () => {
        // We execute the same script as before
        let vh = window.innerHeight * 0.01;
            document.documentElement.style.setProperty('--vh', `${vh}px`);
        })
*/
window.addEventListener("orientationchange", function() {
        let vh = window.innerHeight * 0.01;
        document.documentElement.style.setProperty('--vh', `${vh}px`);
    }, false);
        // We listen to the resize event
        window.addEventListener('resize', () => {
        // We execute the same script as before
        let vh = window.innerHeight * 0.01;
            document.documentElement.style.setProperty('--vh', `${vh}px`);
        });
    </script>
